        <tr>
          <td style="padding:20px 5px 0px 10px; line-height:2;"><strong>1、作一个爱国、爱家、爱笑、爱玩、爱投票的五爱青年！</strong><br />
　　拿着菜刀砍电线，一路火花带闪电。干什么去？<br />
　　投票去？那也不用做这么高难度动作吧，虽然时间也越来越有限了。咱们是规矩是两小时可以投一次票，那么只要时间安排合理，冲进前十的可能性还是蛮大的；如果再呼朋引伴，寻二三知己，或是在的QQ群里吼一嗓子，效果也会是&ldquo;刚刚地&rdquo;。让我们全体都在为爱国、爱家、爱笑、爱玩、爱投票的五爱青年。<br />
　　时间乘着神七，跑得飞快，威氏亚&ldquo;笑傲江湖-寻找最美丽的笑脸&rdquo;居然到了投票期了！虽然发过大喇叭通知，但还是有几位朋友坚持发了笑脸照片，真的十分感谢你们对活动的支持，可是但是以及真的没办法，游戏规则已经制定，谁也不能破坏，本身也是对活动和参加者的尊重。所以我们真的十分遗憾，只能说遗憾，谢谢您的参加和支持，谢谢你们理解。<br /><br/>
  <strong>2、投票时间到了！</strong><br/>
　　二十天，提交相片期结束了，决战，就在眼前。<br/>
　　如果把笑脸征集比作爬山，那么我们就要瞪顶了。在这关键时期，千万不要放松，加油努力，无限风光在险峰，正如菜市场那位修鞋大爷说的：&ldquo;只要心态不下坡，办法总比问题多&rdquo;。 每个IP每两小时就可以投一次票，把投票页打开别关，过两小时投一回，一边上班一边投票。先给大家介绍几位先贤的办法。<br/>
　　鬼谷子说：三十六计，别用那条上计<br/>
　　苏秦说：合纵<br/>
　　张仪说：连横<br/>
　　孙子说：看我的兵法去吧<br/>
　　注意中间两条，苏秦张仪比较实在，一人的力量终究有限，大家团结在一起才更有力量。一个好汉三个帮，那还等什么呀，快去找哇找哇找哇找朋友，告诉大家来帮忙，得奖之后，请吃饭。<br /><br />
